  }
  window.addEventListener('resize', resize, {passive:true});
  let zoom=1, linksAlpha=0.12, showLabels=false;
  const hubs = data.hubs, nodes=data.nodes, edges=data.edges;
  const Cx=()=>(width/2), Cy=()=>(height/2);
  const Rbig=()=>Math.min(width,height)*0.33;
  const hubAnchors = hubs.map((h,i)=>{
    const a=(i/hubs.length)*Math.PI*2 - Math.PI/2;
    return {x:Cx()+Rbig()*Math.cos(a), y:Cy()+Rbig()*Math.sin(a)};
  });
  const byHub = new Map(hubs.map((h,i)=>[i,[]]));
  nodes.forEach(n=>{ const idx=Math.min(n.bucket, hubs.length-1); byHub.get(idx).push(n); });
  byHub.forEach((arr, hi)=>{
    const A=hubAnchors[hi]; let k=0;
    for(let r=0;r<100;r++){
      const ring = 36 + r*22; const count = Math.ceil(Math.PI*2*ring/18);
      for(let t=0;t<count && k<arr.length;t++,k++){
        const ang=(t/count)*Math.PI*2 + (hi*0.21);
        arr[k].x = A.x + ring*Math.cos(ang);
        arr[k].y = A.y + ring*Math.sin(ang);
      }
      if(k>=arr.length) break;
    }
  });
  const idx = new Map(nodes.map((n,i)=>[n.id,i]));
  function draw(clear=false){
    if(clear){ ctx.fillStyle='#0b0f17'; ctx.fillRect(0,0,width,height); }
    // edges
    ctx.globalAlpha = linksAlpha; ctx.strokeStyle='#5f6d8d'; ctx.lineWidth=0.6;
    ctx.beginPath();
    for(const e of edges){
      const a=nodes[idx.get(e.s)], b=nodes[idx.get(e.t)]; if(!a||!b) continue;
      const x1=Cx()+(a.x-Cx())*zoom, y1=Cy()+(a.y-Cy())*zoom;
      const x2=Cx()+(b.x-Cx())*zoom, y2=Cy()+(b.y-Cy())*zoom;
      ctx.moveTo(x1,y1); ctx.lineTo(x2,y2);
    }
    ctx.stroke(); ctx.globalAlpha=1;
    // hubs
    hubs.forEach((h,i)=>{
      const A=hubAnchors[i]; const x=Cx()+(A.x-Cx())*zoom, y=Cy()+(A.y-Cy())*zoom;
      ctx.fillStyle='#1b2a45'; ctx.beginPath(); ctx.arc(x,y,18,0,Math.PI*2); ctx.fill();
      ctx.fillStyle='#cfe0ff'; ctx.font='12px ui-sans-serif'; ctx.textAlign='center';
      ctx.fillText(h, x, y-26);
    });
    // nodes
    ctx.fillStyle='#8ad8ff';
    for(const n of nodes){ const x=Cx()+(n.x-Cx())*zoom, y=Cy()+(n.y-Cy())*zoom;
      ctx.beginPath(); ctx.arc(x,y,2.1,0,Math.PI*2); ctx.fill(); }
    if(showLabels && zoom>1.2){
      ctx.fillStyle='#e8eefc'; ctx.font='10px ui-sans-serif'; ctx.textAlign='left';
      for(const n of nodes){ const x=Cx()+(n.x-Cx())*zoom, y=Cy()+(n.y-Cy())*zoom;
        ctx.fillText(n.label.slice(0,64), x+4, y+3); }
    }
  }
  resize();
  // UI
  const z = document.getElementById('zoomRange');
  const l = document.getElementById('linksRange');
  const lab = document.getElementById('labelsToggle');
  if(z){ z.addEventListener('input', ()=>{ zoom=parseFloat(z.value); draw(true);}); }
  if(l){ l.addEventListener('input', ()=>{ linksAlpha=parseFloat(l.value); draw(true);}); }
  if(lab){ lab.addEventListener('change', ()=>{ showLabels=lab.checked; draw(true);}); }
  const s = document.getElementById('searchBox');
  const cbtn = document.getElementById('clearBtn');
  if(s){
    s.addEventListener('input', ()=>{
      const q=s.value.toLowerCase().trim(); draw(true); if(!q) return;
      const hits = nodes.filter(n=> (n.label||'').toLowerCase().includes(q));
      const ctx2=ctx; ctx2.fillStyle='#ffcc66';
      for(const n of hits){ const x=Cx()+(n.x-Cx())*zoom, y=Cy()+(n.y-Cy())*zoom;
        ctx2.beginPath(); ctx2.arc(x,y,3.8,0,Math.PI*2); ctx2.fill(); }
    });
    if(cbtn){ cbtn.addEventListener('click', ()=>{ s.value=''; draw(true); }); }
  }
}
window.addEventListener('DOMContentLoaded', ()=>{
  const data = window.__NUCLEUS_DATA__;
  const canvas = document.getElementById('cv');
  createRenderer(canvas, data);
});
</script>
</body></html>
